    .form-control,
    .form-select {
      padding: 5px 12px;
      font-size: 14px;
      line-height: 20px;
      color: var(--color-fg-default);
      vertical-align: middle;
      background-color: var(--color-canvas-default);
      background-repeat: no-repeat;
      background-position: right 8px center;
      border: 1px solid var(--color-border-default);
      border-radius: 6px;
      outline: none;
      box-shadow: var(--color-primer-shadow-inset)
    }

    .input-contrast {
      background-color: var(--color-canvas-inset)
    }

    .subnav-search {
      position: relative;
      flex: auto;
      display: flex
    }

    .subnav-search-input {
      flex: auto;
      padding-left: 32px;
      color: var(--color-fg-muted)
    }

    .subnav-search-icon {
      position: absolute;
      top: 9px;
      left: 8px;
      display: block;
      color: var(--color-fg-muted);
      text-align: center;
      pointer-events: none
    }

    .subnav-search-context+.subnav-search {
      margin-left: -1px
    }

    .subnav-item {
      flex: none;
      position: relative;
      float: left;
      padding: 5px 8px;
      font-weight: 500;
      line-height: 20px;
      color: var(--color-fg-default);
      border: 1px solid var(--color-border-default);
      -webkit-user-select: none;
      user-select: none
    }

    .subnav-item:hover {
      background-color: var(--color-canvas-subtle)
    }

    .subnav-item:first-child {
      border-top-left-radius: 6px;
      border-bottom-left-radius: 6px
    }

    .subnav-item:last-child {
      border-top-right-radius: 6px;
      border-bottom-right-radius: 6px
    }

    .subnav-item+.subnav-item {
      margin-left: -1px
    }

    .subnav-item .octicon,
    .subnav-item-label {
      margin-right: 8px
    }

    .counter {
      display: inline-block;
      min-width: 20px;
      padding: 0 6px;
      font-size: 12px;
      font-weight: 500;
      line-height: 18px;
      color: var(--color-fg-default);
      text-align: center;
      background-color: var(--color-neutral-muted);
      border: 1px solid transparent;
      border-radius: 2em
    }

    .color-icon-success {
      color: var(--color-success-fg) !important
    }

    .color-text-danger {
      color: var(--color-danger-fg) !important
    }

    .color-text-warning {
      color: var(--color-checks-step-warning-text) !important
    }

    .color-fg-muted {
      color: var(--color-fg-muted) !important
    }

    .octicon {
      display: inline-block;
      overflow: visible !important;
      vertical-align: text-bottom;
      fill: currentColor;
      margin-right: 7px;
      flex: none
    }

    .button {
      flex: none;
      height: 24px;
      border: 1px solid var(--color-btn-border);
      outline: none;
      color: var(--color-btn-text);
      background: var(--color-btn-bg);
      padding: 4px;
      cursor: pointer;
      display: inline-flex;
      align-items: center;
      justify-content: center;
      border-radius: 4px
    }

    .button:not(:disabled):hover {
      border-color: var(--color-btn-hover-border);
      background-color: var(--color-btn-hover-bg)
    }

    @media only screen and (max-width: 600px) {

      .subnav-item,
      .form-control {
        border-radius: 0 !important
      }

      .subnav-item {
        border: none
      }

      .subnav-search-input {
        border-left: 0;
        border-right: 0
      }
    }

    .header-view-status-container {
      float: right
    }

    .header-view {
      padding: 12px 8px 0
    }

    .header-view div {
      flex-shrink: 0;
      flex-wrap: wrap
    }

    .header-superheader {
      color: var(--color-fg-muted)
    }

    .header-title {
      flex: none;
      font-weight: 400;
      font-size: 32px;
      line-height: 1.25
    }

    @media only screen and (max-width: 600px) {
      .header-view {
        padding: 0
      }

      .header-view div {
        flex-shrink: 1
      }

      .header-view-status-container {
        float: none;
        margin: 0 0 10px !important;
        overflow: hidden
      }

      .header-view-status-container .subnav-search-input {
        border-left: none;
        border-right: none
      }

      .header-title,
      .header-superheader {
        margin: 0 8px
      }
    }

    .copy-icon {
      flex: none;
      height: 24px;
      width: 24px;
      border: none;
      outline: none;
      color: var(--color-fg-muted);
      background: transparent;
      padding: 4px;
      cursor: pointer;
      display: inline-flex;
      align-items: center;
      justify-content: center;
      border-radius: 4px
    }

    .copy-icon svg {
      margin: 0
    }

    .copy-icon:not(:disabled):hover {
      background-color: var(--color-border-default)
    }

    .copy-button-container {
      visibility: hidden;
      display: inline-flex;
      margin-left: 8px;
      vertical-align: bottom
    }

    .copy-value-container:hover .copy-button-container {
      visibility: visible
    }

    .attachment-body {
      white-space: pre-wrap;
      background-color: var(--color-canvas-subtle);
      margin-left: 24px;
      line-height: normal;
      padding: 8px;
      font-family: monospace;
      position: relative
    }

    .attachment-body .copy-icon {
      position: absolute;
      right: 5px;
      top: 5px
    }

    .link-badge {
      flex: none;
      background-color: transparent;
      border-color: transparent;
      -webkit-user-select: none;
      user-select: none
    }

    .link-badge-dim span {
      color: var(--color-fg-muted)
    }

    .link-badge:hover {
      cursor: pointer
    }

    .link-badge svg {
      fill: var(--color-fg-default)
    }

    .link-badge-dim svg {
      fill: var(--color-fg-muted)
    }

    .link-badge-dim:hover svg {
      fill: var(--color-fg-muted)
    }

    .trace-link {
      margin-right: 3px
    }

    .trace-link-separator {
      color: var(--color-fg-muted);
      -webkit-user-select: none;
      user-select: none
    }

    .expandable-summary {
      cursor: pointer;
      list-style: none;
      white-space: nowrap;
      padding-left: 4px
    }

    .label {
      display: inline-block;
      padding: 0 8px;
      font-size: 12px;
      font-weight: 500;
      line-height: 18px;
      border: 1px solid transparent;
      border-radius: 2em;
      background-color: var(--color-scale-gray-4);
      color: #fff;
      margin: 0 10px;
      flex: none;
      font-weight: 600;
      cursor: pointer
    }

    .label-anchor {
      text-decoration: none;
      color: var(--color-fg-default)
    }

    @media (prefers-color-scheme: light) {
      .label-color-0 {
        background-color: var(--color-scale-blue-0);
        color: var(--color-scale-blue-6);
        border: 1px solid var(--color-scale-blue-4)
      }

      .label-color-1 {
        background-color: var(--color-scale-yellow-0);
        color: var(--color-scale-yellow-6);
        border: 1px solid var(--color-scale-yellow-4)
      }

      .label-color-2 {
        background-color: var(--color-scale-purple-0);
        color: var(--color-scale-purple-6);
        border: 1px solid var(--color-scale-purple-4)
      }

      .label-color-3 {
        background-color: var(--color-scale-pink-0);
        color: var(--color-scale-pink-6);
        border: 1px solid var(--color-scale-pink-4)
      }

      .label-color-4 {
        background-color: var(--color-scale-coral-0);
        color: var(--color-scale-coral-6);
        border: 1px solid var(--color-scale-coral-4)
      }

      .label-color-5 {
        background-color: var(--color-scale-orange-0);
        color: var(--color-scale-orange-6);
        border: 1px solid var(--color-scale-orange-4)
      }
    }

    @media (prefers-color-scheme: dark) {
      .label-color-0 {
        background-color: var(--color-scale-blue-9);
        color: var(--color-scale-blue-2);
        border: 1px solid var(--color-scale-blue-4)
      }

      .label-color-1 {
        background-color: var(--color-scale-yellow-9);
        color: var(--color-scale-yellow-2);
        border: 1px solid var(--color-scale-yellow-4)
      }

      .label-color-2 {
        background-color: var(--color-scale-purple-9);
        color: var(--color-scale-purple-2);
        border: 1px solid var(--color-scale-purple-4)
      }

      .label-color-3 {
        background-color: var(--color-scale-pink-9);
        color: var(--color-scale-pink-2);
        border: 1px solid var(--color-scale-pink-4)
      }

      .label-color-4 {
        background-color: var(--color-scale-coral-9);
        color: var(--color-scale-coral-2);
        border: 1px solid var(--color-scale-coral-4)
      }

      .label-color-5 {
        background-color: var(--color-scale-orange-9);
        color: var(--color-scale-orange-2);
        border: 1px solid var(--color-scale-orange-4)
      }
    }

    .label-row .label {
      margin: 0
    }

    .label-row .label:not(:first-child) {
      margin-left: 6px
    }

    html,
    body {
      width: 100%;
      height: 100%;
      padding: 0;
      margin: 0;
      overscroll-behavior-x: none
    }

    body {
      overflow: auto;
      max-width: 1024px;
      margin: 0 auto;
      width: 100%

      border-top: 1px solid var(--color-border-default)

    @media only screen and (max-width: 600px) {
      .htmlreport {
        padding: 0 !important
      }
    }

    .tabbed-pane {
      display: flex;
      flex: auto;
      overflow: hidden
    }

    .tabbed-pane-tab-strip {
      display: flex;
      align-items: center;
      padding-right: 10px;
      flex: none;
      width: 100%;
      z-index: 2;
      font-size: 14px;
      line-height: 32px;
      color: var(--color-fg-default);
      height: 48px;
      min-width: 70px;
      box-shadow: inset 0 -1px 0 var(--color-border-muted) !important
    }

    .tabbed-pane-tab-strip:focus {
      outline: none
    }

    .tabbed-pane-tab-element {
      padding: 4px 8px 0;
      margin-right: 4px;
      cursor: pointer;
      display: flex;
      flex: none;
      align-items: center;
      justify-content: center;
      -webkit-user-select: none;
      user-select: none;
      border-bottom: 2px solid transparent;
      outline: none;
      height: 100%
    }

    .tabbed-pane-tab-label {
      max-width: 250px;
      white-space: pre;
      overflow: hidden;
      text-overflow: ellipsis;
      display: inline-block
    }

    .tabbed-pane-tab-element.selected {
      border-bottom-color: #666
    }

    .tabbed-pane-tab-element:hover {
      color: #333
    }

    .chip-header {
      border: 1px solid var(--color-border-default);
      border-top-left-radius: 6px;
      border-top-right-radius: 6px;
      background-color: var(--color-canvas-subtle);
      padding: 0 8px;
      border-bottom: none;
      margin-top: 12px;
      font-weight: 600;
      line-height: 38px;
      white-space: nowrap;
      overflow: hidden;
      text-overflow: ellipsis;
      -webkit-user-select: none;
      user-select: none
    }

    .chip-header-allow-selection {
      -webkit-user-select: text;
      user-select: text
    }

    .chip-header.expanded-false {
      border: 1px solid var(--color-border-default);
      border-radius: 6px
    }

    .chip-header.expanded-false,
    .chip-header.expanded-true {
      cursor: pointer
    }

    .chip-body {
      border: 1px solid var(--color-border-default);
      border-bottom-left-radius: 6px;
      border-bottom-right-radius: 6px;
      padding: 16px;
      margin-bottom: 12px
    }

    .chip-body-no-insets {
      padding: 0
    }

    @media only screen and (max-width: 600px) {
      .chip-header {
        border-radius: 0;
        border-right: none;
        border-left: none
      }

      .chip-body {
        border-radius: 0;
        border-right: none;
        border-left: none;
        padding: 8px
      }

      .chip-body-no-insets {
        padding: 0
      }
    }

    .test-case-column {
      border-radius: 6px;
      margin-bottom: 24px
    }

    .test-case-column .tab-element.selected {
      font-weight: 600;
      border-bottom-color: var(--color-primer-border-active)
    }

    .test-case-column .tab-element {
      border: none;
      color: var(--color-fg-default);
      border-bottom: 2px solid transparent
    }

    .test-case-column .tab-element:hover {
      color: var(--color-fg-default)
    }

    .test-case-location,
    .test-case-duration {
      flex: none;
      align-items: center;
      padding: 0 8px 8px
    }

    .test-case-run-duration {
      color: var(--color-fg-muted);
      padding-left: 8px
    }

    .header-view .test-case-path {
      flex: none;
      flex-shrink: 1;
      align-items: center;
      padding-right: 8px
    }

    .test-case-annotation {
      flex: none;
      align-items: center;
      padding: 0 8px;
      line-height: 24px;
      white-space: pre-wrap
    }

    @media only screen and (max-width: 600px) {
      .test-case-column {
        border-radius: 0 !important;
        margin: 0 !important
      }
    }

    .tree-item {
      text-overflow: ellipsis;
      overflow: hidden;
      white-space: nowrap;
      line-height: 38px
    }

    .tree-item-title {
      cursor: pointer
    }

    .tree-item-body {
      min-height: 18px
    }

    .yellow-flash {
      animation: yellowflash-bg 2s
    }

      0% {
        background: var(--color-attention-subtle)
      }

      to {
        background: transparent
      }

    .test-error-container {
      position: relative;
      white-space: pre;
      flex: none;
      padding: 0;
      background-color: var(--color-canvas-subtle);
      border-radius: 6px;
      line-height: initial;
      margin-bottom: 6px
    }

    .test-error-view {
      overflow: auto;
      padding: 16px
    }

    .test-error-text {
      font-family: monospace
    }

    .test-result {
      flex: auto;
      display: flex;
      flex-direction: column;
      margin-bottom: 24px
    }

    .test-result>div {
      flex: none
    }

    .test-result video,
    .test-result img.screenshot {
      flex: none;
      box-shadow: var(--box-shadow-thick);
      margin: 24px auto;
      min-width: 200px;
      max-width: 80%
    }

    .test-result-path {
      padding: 0 0 0 5px;
      color: var(--color-fg-muted)
    }

    .test-result-counter {
      border-radius: 12px;
      color: var(--color-canvas-default);
      padding: 2px 8px
    }

    @media (prefers-color-scheme: light) {
      .test-result-counter {
        background: var(--color-scale-gray-5)
      }
    }

    @media (prefers-color-scheme: dark) {
      .test-result-counter {
        background: var(--color-scale-gray-3)
      }
    }

    @media only screen and (max-width: 600px) {
      .test-result {
        padding: 0 !important
      }
    }

    .test-file-test {
      line-height: 32px;
      align-items: center;
      padding: 2px 8px;
      overflow: hidden;
      text-overflow: ellipsis
    }

    .test-file-test:hover {
      background-color: var(--color-canvas-subtle)
    }

    .test-file-title {
      font-weight: 600;
      font-size: 16px
    }

    .test-file-details-row {
      padding: 0 0 6px 8px;
      margin: 0 0 0 15px;
      line-height: 16px;
      font-weight: 400;
      color: var(--color-fg-muted);
      display: flex;
      align-items: center
    }

    .test-file-details-row-items {
      display: flex;
      height: 16px
    }

    .test-file-details-row-items>.link-badge {
      margin-top: -2px
    }

    .test-file-details-row-items>.trace-link {
      margin-top: -4px
    }

    .test-file-path {
      text-overflow: ellipsis;
      overflow: hidden;
      color: var(--color-fg-muted)
    }

    .test-file-path-link {
      margin-right: 10px
    }

    .test-file-test-outcome-skipped {
      color: var(--color-fg-muted)
    }

    .test-file-test-status-icon {
      flex: none
    }

    .test-file-header-info {
      display: flex;
      align-items: center;
      gap: 4px 8px;
      color: var(--color-fg-muted)
    }

    .test-file-header-br {
      flex-basis: 100%;
      height: 0
    }

    #root {
      color: var(--color-fg-default);
      font-size: 14px;
      font-family: -apple-system, BlinkMacSystemFont, Segoe UI, Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji";
      -webkit-font-smoothing: antialiased
    }

    .metadata-toggle {
      cursor: pointer;
      -webkit-user-select: none;
      user-select: none;
      color: var(--color-fg-default)
    }

    .metadata-toggle-second-line {
      margin-top: 8px;
      margin-left: 8px
    }

    .metadata-view {
      border: 1px solid var(--color-border-default);
      border-radius: 6px;
      margin-top: 12px
    }

    .metadata-view .metadata-section {
      margin: 8px 10px 8px 32px
    }

    .metadata-view span:not(.copy-button-container),
    .metadata-view a {
      display: inline-block;
      line-height: 24px
    }

    .metadata-properties {
      display: flex;
      flex-direction: column;
      align-items: normal;
      gap: 8px
    }

    .metadata-properties>div {
      height: 24px
    }

    .metadata-separator {
      height: 1px;
      border-bottom: 1px solid var(--color-border-default)
    }

    .metadata-view a {
      color: var(--color-fg-default)
    }

    .copyable-property {
      white-space: pre
    }

    .copyable-property>span {
      display: flex;
      align-items: center
    }
